import styled from 'styled-components';

export const StyledDashboard = styled.div`
 .main {
     width: 100%;
 }

 .link{
     list-style-type: none;
     width: 120px;
     height: 30px;
     padding: 5px;
     margin:20px;
     background-color: greenyellow;
     text-align: center;
     padding-top: 15px;
     color: red;
 }
 a{
     text-decoration: none;
 }
`;
